        'FOOTNOTE?': 'y',
        'Footnote text': 'It is possible that Gen 21:8-21 serves as a sort of prologue or prelude to Gen 22:1-19. There are striking parallels: (1) The life of the son is threatened (in 21 by Sarah, 22 by God); (2) God gives an order which Abraham obeys (21:12-14; 22:1-3); (3) The life of a boy is saved by a heavenly intervention ( in 21:17 et 22:11, 15); (4) The rescue does not return Abrahams sons, for each is henceforth separated from their father (in 21:21 Ishmael lives far away from Abraham; in 22:19 Abraham returns without Isaac).'
